import React, { Component } from "react";
import WebLogo from "./HeaderComponent";

export default class Footer extends Component {
  render() {
    return (
      <footer style={{ backgroundColor: "var(--orange-dark)" }}>
        <div class="container">
          <div class="web-icon">
            <span style={webIconStyle} class="rubik-dirt-font">
              MangaPunch
            </span>
            <span>
              <img
                src={icon}
                alt="onepunch-icon"
                style={{ width: "78px" }}
              ></img>
            </span>
          </div>
        </div>
      </footer>
    );
  }
}
